import React from 'react';
import { useLocation } from 'react-router-dom';

const Home = () => {
    const location = useLocation();
    const { user } = location.state || {};

    return (
        <div>
            <h1>Welcome, {user?.username}</h1>
            <p>Email: {user?.email}</p>
        </div>
    );
};

export default Home;
